  return (
    <div>
      <Header />
      <Banner page={"services"} />
      <div className="text-center text-info display-1 fw-bold">
        SERVICES IS COMING SOON
      </div>
      {/* <div style={{ marginTop: "0px" }}>
        {" "}
        <ServiceCard />
      </div> */}
      <Footer />
    </div>
  );
};

export default Services;
